function pricefilter(){
  var selected = document.querySelector("#pricing").value;
  if(selected=="lth"){
    productArr.sort(function(a,b){
    return a.cost-b.cost;
    });
    displayData(productArr);
  }
  if(selected=="htl"){
    productArr.sort(function(a,b){
    return b.cost-a.cost;
    });
    displayData(productArr);
  }

}
